import React from "react";
import Grid from "@material-ui/core/Grid";

const BookList = ({ books }) => {

	return (
		<div className="book-list">
    			{arrayRow(books, 5).map((row,) => (
            <div className="book">
              <img className="book-cover" src={book.image}/>
        			<p><i>{book.title}</i></p>
              <p>by {book.author}</p>
        			<p>{book.rating}</p>
            </div>
    			))}
    </div>
	);
};

export default BookList;
